import React, { useEffect, useState } from "react";
import IndexNavbar from "components/Navbars/IndexNavbar.js";
import Footerr from "components/Footers/Footerr";
import { Link } from "react-router-dom";

function MyTickets() {
  const [tickets, setTickets] = useState([]);
  const [loading, setLoading] = useState(true);

  // Fonction pour rÃ©cupÃ©rer les tickets depuis l'API
  useEffect(() => {
    const fetchTickets = async () => {
      try {
        const response = await fetch("/api/tickets");
        const result = await response.json();
        if (response.ok) {
          setTickets(result);
        } else {
          console.error("Erreur lors de la rÃ©cupÃ©ration des tickets:", result);
        }
      } catch (error) {
        console.error("Erreur de rÃ©seau:", error);
      } finally {
        setLoading(false);
      }
    };

    fetchTickets();
  }, []);

  if (loading) {
    return (
      <>
        <IndexNavbar />
        <div style={loadingContainer}>
          <h2 style={loadingText}>Chargement des tickets...</h2>
        </div>
        <Footerr />
      </>
    );
  }

  return (
    <>
      <IndexNavbar />
      <div style={container}>
        <div style={card}>
          <h2 style={title}>ðŸŽ« Mes Tickets</h2>

          {tickets.length === 0 ? (
            <p style={noTicketsMessage}>Vous n'avez aucun ticket crÃ©Ã©.</p>
          ) : (
            <div style={ticketList}>
              {tickets.map((ticket) => (
                <div key={ticket.id} style={ticketItem}>
                  <h3 style={ticketTitle}>{ticket.sujet}</h3>
                  <p style={ticketDescription}>{ticket.description}</p>
                  <p style={ticketStatus}>
                    <strong>Statut:</strong> {ticket.statut}
                  </p>
                  <p style={ticketDate}>
                    <strong>Date:</strong> {ticket.date}
                  </p>
                  <Link to={`/ticket/${ticket.id}`} style={ticketLink}>
                    DÃ©tails
                  </Link>
                </div>
              ))}
            </div>
          )}

          <div style={buttonGroup}>
            <Link to="/NewTicket" style={addTicketLink}>
              + CrÃ©er un nouveau ticket
            </Link>
          </div>
        </div>
      </div>
      <Footerr />
    </>
  );
}

// ðŸŒŸ Styles sobres et bancaires
const container = {
  backgroundColor: "#f1f3f6",
  minHeight: "100vh",
  display: "flex",
  justifyContent: "center",
  alignItems: "center",
  padding: "2rem",
};

const card = {
  backgroundColor: "#fff",
  borderRadius: "16px",
  boxShadow: "0 8px 24px rgba(0, 0, 0, 0.07)",
  padding: "2rem",
  maxWidth: "900px",
  width: "100%",
};

const title = {
  fontSize: "2rem",
  fontWeight: "700",
  color: "#003366",
  marginBottom: "1.5rem",
};

const ticketList = {
  display: "flex",
  flexDirection: "column",
  gap: "1rem",
};

const ticketItem = {
  padding: "1rem",
  backgroundColor: "#f9f9f9",
  borderRadius: "8px",
  boxShadow: "0 4px 8px rgba(0, 0, 0, 0.1)",
};

const ticketTitle = {
  fontSize: "1.2rem",
  fontWeight: "600",
  color: "#003366",
};

const ticketDescription = {
  color: "#555",
  margin: "0.5rem 0",
};

const ticketStatus = {
  color: "#009688",
  fontWeight: "500",
};

const ticketDate = {
  fontSize: "0.9rem",
  color: "#888",
};

const ticketLink = {
  color: "#003366",
  textDecoration: "none",
  fontWeight: "600",
  marginTop: "1rem",
  display: "inline-block",
};

const buttonGroup = {
  marginTop: "2rem",
  display: "flex",
  justifyContent: "flex-end",
};

const addTicketLink = {
  backgroundColor: "#003366",
  color: "#fff",
  padding: "0.8rem 1.6rem",
  borderRadius: "8px",
  textDecoration: "none",
  fontWeight: "600",
};

const noTicketsMessage = {
  fontSize: "1rem",
  color: "#555",
};

const loadingContainer = {
  display: "flex",
  justifyContent: "center",
  alignItems: "center",
  height: "60vh",
};

const loadingText = {
  fontSize: "1.5rem",
  color: "#003366",
};

export default MyTickets;
